import './App.scss';

import Footer from './components/Footer';

import { BrowserRouter as Router } from 'react-router-dom';
import { Canvas } from 'react-three-fiber';



function App() {
  return (
    <Router>
      <>
        <Canvas>
          <mesh>
            <boxBufferGeometry attach='geometry'></boxBufferGeometry>
          </mesh>
        </Canvas>

        <Footer></Footer>
      </>
    </Router>
  );
}

export default App;
